INSERT INTO `wp_comments` VALUES (1,1,'A WordPress Commenter','wapuu@wordpress.example','https://wordpress.org/','','2024-06-04 12:43:21','2024-06-04 12:43:21','Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://en.gravatar.com/\">Gravatar</a>.',0,'1','','comment',0,0),(2,20,'Roger','compudoctors1@yahoo.com','','96.43.136.242','2024-07-03 14:10:03','2024-07-03 14:10:03','I used to just hold a beer when warm and wait to throw it out, I am not a fast drinker. With the penguin pucks I can actually finish a drink and it\'s cold to the very end.',0,'0','Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:127.0) Gecko/20100101 Firefox/127.0','review',0,0);
